import React from "react";
import RouterPage from "./comp/route/router";
import Navbar from "./comp/navbar";
import Footer from "./comp/footer";
function App() {
  return (
    <div className="main">
      <RouterPage />
    </div>
  );
}

export default App;

<Router>
  <Switch>
    <Route exact path="/">
      <Navbar />
      <App />
      <Footer />
    </Route>
  </Switch>
</Router>;
